import React from 'react';
import styled from 'styled-components';

export const Wrapper = styled.div`
    display: flex;
    flex: 1;
    width: 95%;
    margin-left: 2.5%;
    font-family:sans-serif;
    font-size: 24px;

    color: white;
    border-radius: 20px;
`;

export const LogoBrandWrapper = styled.div`
    display: flex;
    flex:1;
    align-items: center;
    margin-left: 80px;
`;

export const FindWrapper = styled.div`
    display: flex;
    flex:1;
    align-items: center;
    justify-content: end;
    margin-top: 20px;
    margin-bottom: 20px;
    gap:20px;

